import './App.css';

function App() {
  const users = [
    {
      id: 1,
      name: 'aref',
    },
  ];

  return (
    <div className="App">
      <div>
        {users.map((user) => (
          <h1>user.id</h1>
        ))}
      </div>
    </div>
  );
}

export default App;
